import { Route, Routes } from "react-router-dom";
import Navbar from "./components/common/Navbar";
import Landing_main from "./pages/Landing_main";
import Buy from "./pages/Buy";

function App() {
  return (
    <>
      <Navbar />
      <div className="App">
        <Routes>
          <Route path="/" element={<Landing_main />}></Route>
          <Route path="/" element={<Buy />}></Route>
          <Route path="/" element={<Rent />}></Route>
          <Route path="/" element={<Share />}></Route>
          <Route path="/" element={<Login />}></Route>
        </Routes>
      </div>
    </>
  );
}

export default App;
